import React from 'react';

const SpotifyPlaylistButtons = ({ playlists }) => {
  return (
    <div>
      {playlists.map((playlist) => (
        <a
          key={playlist.id}
          href={playlist.externalUrl}
          className="spotify-button"
          target="_blank"
          rel="noopener noreferrer"
        >
          {playlist.name}
        </a>
      ))}
    </div>
  );
};

export default SpotifyPlaylistButtons;
